const Logo =() => {
    return (
        <div className='ma4 mt0'>
            <Tilt className='br2 shadow-3' options={{max: 55}} style={{ height: '150px',width: '130px'}}>
                <div>
                    <h1>hi</h1>
                </div>
            </Tilt>
        </div>
    );
};

export default Logo;
